BBC Four explores the archives for the sultry sounds and looks 
of 'Jazz Divas Gold'! Featured Jazz legends include Ella Fitzgerald, 
Marion Montgomery, Cleo Laine, Blossom Dearie, Sarah Vaughan, 
Nina Simone, Peggy Lee, Betty Carter, Amy Winehouse, Eartha Kitt 
and many more who can be seen from 1965 to 2008 on BBC treasures 
such as Not So Much a Programme, More a Way of Life, Show of the 
Week, Not Only...But Also, Birdland, Parkinson, Later..with Jools 
Holland, Morecambe and Wise and more...so let's hear it for the 
ladies!

